export default () => {
  return (
    <div>
      <div className='bg-earth bg-no-repeat bg-fixed min-h-screen flex justify-center items-center'>
        <div className='box relative bg-black bg-opacity-90 rounded-lg p-6 max-w-lg'>
          <img className='box-img object-contain float-left w-16 mr-4 mb-1 mt-2 rounded-lg' src='/assets/static/iam.jpg' alt='' />
          <p className='box-text text-lg text-white'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Ratione repudiandae quas atque, culpa tenetur magni repellendus eum illo rerum autem, maxime reiciendis vitae architecto aliquid laudantium voluptas perferendis eveniet quam!Delectus similique nemo beatae iusto dolores facilis possimus suscipit nesciunt natus dolorum optio ratione veritatis, soluta iste officiis fugit, tempore dolorem odio in? Ipsam est provident numquam quae, enim cupiditate.</p>
        </div>
      </div>
      <style jsx>{`
        .bg-earth::before {
          content: "";
          position: absolute;
          top: 0;
          left: 0;
          width: 100%; height: 100%;
          background-image: url("/assets/static/earth.jpg");
          filter: sepia(60%);
        }
        .box {
          box-shadow: 0 0 5px black,0 0 10px black,0 0 15px black,0 0 20px red,0 0 25px red;
        }
        .box-img {
          filter: hue-rotate(90deg);
        }
        .bg-opacity-90{
          --bg-opacity: 0.90;
        };
        .box-text {
          /*text-shadow: 0 0 5px #ffffff, 0 0 10px red, 0 0 15px red;
          box-shadow: 0 0 5px #fff,0 0 10px #fff,0 0 15px #fff,0 0 20px #076eb3,0 0 25px #076eb3;*/
        }
      `}</style>
    </div>
  )
}
